import React , { Component} from 'react';

import "./DetectPotential.css";
import Slider from "react-slick";

// import OwlCarousel from 'react-owl-carousel';
// import 'owl.carousel/dist/assets/owl.carousel.css';
// import 'owl.carousel/dist/assets/owl.theme.default.css';
export default class DetectPotential extends Component {



	render() {
		  var settings = {
      dots: true,
      infinite: true,
      slidesToShow: 3,
      slidesToScroll: 1,
      autoplay: false,
      autoplaySpeed: 2000,
      playOnHover: true
    };
		return(


			<section>
				<div className="detectWrapper">
					<div className="heading4">Detect potential risks in real time</div>
					<div className="underline4"></div>
					<div className="carouselWrapper col-lg-12 col-md-10 col-sm-10 col-xs-10" >


										<div  className="col-lg-12">
									        <h2>Pause On Hover</h2>
									        <Slider {...settings}>
									          <div>
									           <img src="images/AdobeStock_1.jpeg" />
									          </div>
									          <div>
									            <h3>2</h3>
									          </div>
									          <div>
									            <h3>3</h3>
									          </div>
									          <div>
									            <h3>4</h3>
									          </div>
									          <div>
									            <h3>5</h3>
									          </div>
									          <div>
									            <h3>6</h3>
									          </div>
									        </Slider>
      									</div>






					</div>
				</div>

			</section>


			)
	}
}
